import React from 'react'
import './KeyButton.css'



export default function KeyButton(props) {
    return (
       <div className="button-filter" >
           
            <button onClick={ ()=> props.handleSetKey(props.name)}> {props.name.toUpperCase()} </button>
        </div>
    )
}
